(68, '111111111111111', 'incoming', '1212', '2012-10-27 22:15:20', 'Võ Nguyên Giáp sinh ở làng An Xá[2], xã Lộc Thủy, huyện Lệ Thủy, tỉnh Quảng Bình trong một gia đình nhà nho, con của ông Võ Quang Nghiêm (Võ Nguyên Thân), một nhà nho đức độ[3] và mẹ là bà Nguyễn Thị Kiên.[4] Võ Quang Nghiêm là một nho sinh thi cử bất thành về làm hương sư và thầy thuốc Đông y, khi cuộc kháng chiến chống thực dân Pháp bùng nổ, ông bị Pháp bắt, đưa về giam ở Huế và mất trong tù. Sau ngày đất nước hòa bình, con cháu đã tìm thấy và bốc mộ ông đưa về an táng tại nghĩa trang liệt sĩ huyện Lệ Thủy.\r\nVề họ ngoại, ông ngoại Võ Nguyên Giáp quê ở tận Mỹ Đức, đầu nguồn sông Cẩm Ly, một vùng sơn cước, dưới dãy Trường Sơn. Cụ theo văn thân lên đến chức Đề đốc coi đại đồn tiền vệ. Điện tiền thượng tướng quân Tôn Thất Thuyết phò vua Hàm Nghi ra Sơn Phòng-Quảng Bình. Vua xuống chiếu Cần Vương, kêu gọi sĩ phu, con dân Việt đứng lên chống Pháp cứu nguy đất nước. Ông ngoại Võ Nguyên Giáp đem quân Cần Vương, chẳng may ông bị Pháp bắt, tra tấn dã man, nhưng một mực trung thành, không một lời khai báo.\r\nGia đình Võ Nguyên Giáp có 7 anh chị em, nhưng người anh cả và chị cả mất sớm nên còn lại năm, 3 người con gái và 2 người con trai là Võ Nguyên Giáp và Võ Thuần Nho, sau này là Thứ trưởng Bộ Giáo dục. Võ Nguyên Giáp sinh trưởng trong một dòng họ lớn, có tiếng tăm tại làng An Xá, có nhà từ đường khá to ở cuối làng. Cậu sinh ra khi ông nội đã mất, nhưng cậu nhớ như in lúc bà nội mất bà mặc chiếc áo điều thắm.\r\nGia đình cụ Nghiêm thuộc diện nghèo trong làng, quanh năm phải vay nợ nặng lãi của các nhà giàu như nhà Khóa Uy, một Hoa kiều giàu có ở làng Tuy Lộc kề bên. Võ Nguyên Giáp đã có lần theo mẹ chèo thuyền chở thóc đi trả nợ. Tuy còn nhỏ tuổi, nhưng những câu chuyện đêm đêm mẹ kể cho cậu nghe về tướng quân Tôn Thất Thuyết phò vua Hàm Nghi hạ chiếu Cần Vương, kêu gọi các sĩ phu và dân chúng đứng lên chống Pháp bảo vệ non sông, còn cha nói về phong trào đánh Pháp qua bài vè “Thất thủ kinh đô” đầy cảm động, đã gieo vào lòng cậu bé những ấn tượng không bao giờ phai mờ, góp phần nuôi dưỡng ý chí cho sự nghiệp cách mạng sau này.[5]\r\nCha ông, một nhà nho rất nghiêm khắc với con cái trong sinh hoạt gia đình và học hành, giữ gìn nề nếp gia phong của đạo Khổng. Ông khuyên dạy con: Chữ Nho là chữ của thánh hiền, là nho sinh, các con không được nghịch ngợm, dẫm đạp lên sách vở chữ Nho. Ông dạy đám học trò cùng hai con ông: Tạm thiện tự, Ngũ thiên tự và cả ấu học tân thư. Năm tháng học chữ Nho không nhiều nhưng những điều học được trong các sách của Thánh hiền, đặc biệt là Ấu học tân thư, đã có ảnh hưởng sâu sắc trong cả cuộc đời ông.');
